import { createStore, combineReducers } from 'redux';
import fileReducer from './reducer'; // Import your reducer from reducer.js

// Combine your reducers (if you have more than one)
const rootReducer = combineReducers({
  fileData: fileReducer,
});

const store = createStore(
  rootReducer,
  window.__REDUX_DEVTOOLS_EXTENSION__ && window.__REDUX_DEVTOOLS_EXTENSION__() // Optional for Redux DevTools
);

export default store;
